import React from 'react';
import Navbar from '../Navbar/Navbar';
import Welcome from '../Welcome/Welcome';

const landing = ( props ) => {
    return (
        <div>
            <div className='nav_div'>
               <Navbar></Navbar></div>
               <Welcome></Welcome>
           
        </div>
    );
};

export default landing;
